import React, { useContext, useEffect, useState } from "react";
import { AuthContext } from "../AuthContext";
import api from "../api";

// ðŸ‘‰ Put your OpenWeather API key here
const OPENWEATHER_API_KEY = ""; // <-- change this

export default function Dashboard() {
  const { user, logout } = useContext(AuthContext);

  // Saved locations from backend (CRUD)
  const [locations, setLocations] = useState([]);
  const [cityName, setCityName] = useState("");
  const [label, setLabel] = useState("");
  const [notes, setNotes] = useState("");

  // Search + weather result
  const [searchCity, setSearchCity] = useState("");
  const [weatherResult, setWeatherResult] = useState(null);
  const [weatherError, setWeatherError] = useState("");

  const [error, setError] = useState("");

  // -------------- BACKEND: load saved locations ----------------
  const fetchLocations = async () => {
    try {
      const res = await api.get("/locations");
      setLocations(res.data);
    } catch (err) {
      console.error(err);
      setError("Failed to load saved locations.");
    }
  };

  useEffect(() => {
    fetchLocations();
  }, []);

  // -------------- BACKEND: add saved location ----------------
  const handleAddLocation = async (e) => {
    e.preventDefault();
    setError("");
    try {
      const res = await api.post("/locations", { cityName, label, notes });
      setLocations([...locations, res.data]);
      setCityName("");
      setLabel("");
      setNotes("");
    } catch (err) {
      console.error(err);
      setError("Failed to add location.");
    }
  };

  // -------------- BACKEND: delete saved location --------------
  const handleDeleteLocation = async (id) => {
    try {
      await api.delete(`/locations/${id}`);
      setLocations(locations.filter((loc) => loc.id !== id));
    } catch (err) {
      console.error(err);
      setError("Failed to delete location.");
    }
  };

  // -------------- FRONTEND: search weather by city ------------
  const handleSearchWeather = async (e) => {
    e.preventDefault();
    setWeatherError("");
    setWeatherResult(null);

    if (!searchCity.trim()) {
      setWeatherError("Please enter a city name.");
      return;
    }

    try {
      const response = await fetch(
        `https://api.openweathermap.org/data/2.5/weather?q=${encodeURIComponent(
          searchCity
        )}&units=metric&appid=${OPENWEATHER_API_KEY}`
      );

      if (!response.ok) {
        if (response.status === 404) {
          setWeatherError("City not found. Try another name.");
        } else {
          setWeatherError("Failed to fetch weather. Try again.");
        }
        return;
      }

      const data = await response.json();
      // We care about: city name, temperature, description, country
      const result = {
        city: data.name,
        country: data.sys?.country,
        temp: data.main?.temp,
        feelsLike: data.main?.feels_like,
        description: data.weather?.[0]?.description,
      };
      setWeatherResult(result);
    } catch (err) {
      console.error(err);
      setWeatherError("Network error while fetching weather.");
    }
  };

  return (
    <div style={styles.container}>
      {/* Header */}
      <div style={styles.header}>
        <h2>Weather App</h2>
        <div>
          <span style={{ marginRight: "10px" }}>
            Logged in as: <strong>{user?.username}</strong>
          </span>
          <button onClick={logout} style={styles.logoutBtn}>
            Logout
          </button>
        </div>
      </div>

      {/* MAIN AIM: Search any location & show temperature */}
      <section style={styles.section}>
        <h3>Search Weather by City</h3>
        <form onSubmit={handleSearchWeather} style={styles.searchForm}>
          <input
            style={styles.input}
            placeholder="Enter city name (e.g., Hyderabad)"
            value={searchCity}
            onChange={(e) => setSearchCity(e.target.value)}
          />
          <button style={styles.button} type="submit">
            Search
          </button>
        </form>

        {weatherError && <p style={{ color: "red" }}>{weatherError}</p>}

        {weatherResult && (
          <div style={styles.weatherCard}>
            <h4>
              {weatherResult.city}
              {weatherResult.country && `, ${weatherResult.country}`}
            </h4>
            <p style={styles.tempText}>{weatherResult.temp} Â°C</p>
            {weatherResult.description && (
              <p style={styles.descText}>
                {weatherResult.description.toUpperCase()}
              </p>
            )}
            {weatherResult.feelsLike !== undefined && (
              <p>Feels like: {weatherResult.feelsLike} Â°C</p>
            )}
          </div>
        )}
      </section>

      {/* Errors from backend CRUD */}
      {error && <p style={{ color: "red" }}>{error}</p>}

      {/* Saved locations CRUD (uses backend) */}
      <section style={styles.section}>
        <h3>Save Favourite Locations</h3>
        <form onSubmit={handleAddLocation} style={styles.form}>
          <input
            style={styles.input}
            placeholder="City Name"
            value={cityName}
            onChange={(e) => setCityName(e.target.value)}
            required
          />
          <input
            style={styles.input}
            placeholder="Label (Home, Office...)"
            value={label}
            onChange={(e) => setLabel(e.target.value)}
          />
          <input
            style={styles.input}
            placeholder="Notes"
            value={notes}
            onChange={(e) => setNotes(e.target.value)}
          />
          <button style={styles.button} type="submit">
            Save
          </button>
        </form>

        <h4>Your Saved Locations</h4>
        {locations.length === 0 ? (
          <p>No saved locations yet.</p>
        ) : (
          <ul style={styles.list}>
            {locations.map((loc) => (
              <li key={loc.id} style={styles.listItem}>
                <div>
                  <strong>{loc.cityName}</strong>{" "}
                  {loc.label && <span>({loc.label})</span>}
                  {loc.notes && (
                    <div style={styles.notes}>Notes: {loc.notes}</div>
                  )}
                </div>
                <button
                  style={styles.deleteBtn}
                  onClick={() => handleDeleteLocation(loc.id)}
                >
                  Delete
                </button>
              </li>
            ))}
          </ul>
        )}
      </section>
    </div>
  );
}

const styles = {
  container: {
    maxWidth: "900px",
    margin: "30px auto",
    padding: "20px",
    border: "1px solid #ddd",
    borderRadius: "8px",
    fontFamily: "Arial, sans-serif",
  },
  header: {
    display: "flex",
    justifyContent: "space-between",
    marginBottom: "20px",
    alignItems: "center",
  },
  logoutBtn: {
    padding: "6px 10px",
    cursor: "pointer",
  },
  section: {
    marginBottom: "25px",
  },
  searchForm: {
    display: "flex",
    gap: "10px",
    maxWidth: "500px",
    marginTop: "10px",
  },
  form: {
    display: "flex",
    gap: "8px",
    flexWrap: "wrap",
    marginTop: "10px",
  },
  input: {
    padding: "8px",
    flex: "1 1 150px",
    minWidth: "150px",
  },
  button: {
    padding: "8px 16px",
    cursor: "pointer",
  },
  weatherCard: {
    marginTop: "15px",
    padding: "15px",
    borderRadius: "8px",
    border: "1px solid #ccc",
    display: "inline-block",
    minWidth: "220px",
  },
  tempText: {
    fontSize: "32px",
    margin: "5px 0",
  },
  descText: {
    fontSize: "14px",
    color: "#555",
  },
  list: {
    listStyle: "none",
    padding: 0,
    marginTop: "10px",
  },
  listItem: {
    display: "flex",
    justifyContent: "space-between",
    padding: "8px 0",
    borderBottom: "1px solid #eee",
    alignItems: "center",
  },
  notes: {
    fontSize: "12px",
    color: "#555",
  },
  deleteBtn: {
    padding: "6px 10px",
    cursor: "pointer",
  },
};
